import React from 'react';
import { BrowserRouter, Link, Route, Routes } from 'react-router-dom';
import classes from './Brands.module.css';
import nikesb from './images/nikesb.png';
import jordan from './images/jordan.png';
import nike from './images/nike.png';
import newbalance from './images/newbalance.png';
import Nike from '../pages/Nike/Nike';

const Brands = () => {
  return (
    <BrowserRouter>
      <div>
        <div className={classes.brands__wrapper}>
          <div className={classes.brands__title}>БРЕНДЫ</div>
          <div className={classes.brands__title}>
            <Link to="/brands">СМОТРЕТЬ ВСЕ</Link>
          </div>
        </div>
        <div style={{ display: 'flex' }}>
          <Routes>
            <Route path="/brands/nike" element={<Nike />} />
          </Routes>
          <Link
            className={classes.brand__navigation}
            style={{ backgroundImage: `url(${nike})` }}
            to="/brands/nike"
          >
            NIKE
          </Link>
          <div className={classes.brand__navigation} style={{ backgroundImage: `url(${nikesb})` }}>
            NIKE SB
          </div>
          <div className={classes.brand__navigation} style={{ backgroundImage: `url(${newbalance})` }}>
            NEW BALANCE
          </div>
          <div className={classes.brand__navigation} style={{ backgroundImage: `url(${jordan})` }}>
            JORDAN
          </div>
        </div>
      </div>
    </BrowserRouter>
  );
};

export default Brands;
